const gaft = new Date().toLocaleTimeString();
const gnig = new Date().toLocaleTimeString();

ReactDOM.render
(
    <>
    <h1> {'Hello sir ${gmor} ${gaft} ${gnig}'} </h1>
    </>,
    document.getElementById("root")

);
